import React from "react";
import classes from "./Categories.module.scss";
import { Link } from "react-router-dom";
const Categories = () => {
  return (
    <div className={classes.categories}>
      <div className={classes.category}>
        <div className={classes.item}>
          <Link to="/" className={classes.link}>
            <img
              width="300"
              height="300"
              src="https://simply-delicious-food.com/wp-content/uploads/2019/07/Pancake-board-2.jpg"
              className={classes.image}
            ></img>

            <h4 className={classes.title}>appetizer</h4>
          </Link>
        </div>
        <div className={classes.item}>Lunch</div>
        <div className={classes.item}>Dinner</div>
        <div className={classes.item}>Appetizers</div>
        <div className={classes.item}>Desserts</div>
      </div>
    </div>
  );
};

export default Categories;
